import {
  PagesTopTitle,
  UserName,
  InfoCard,
} from "../components/Pages/Dashboard/index";
import { NavLink } from "react-router-dom";
import ApexChart from "../components/Pages/Dashboard/New";
const Dashboard = () => {
  return (
    <>
      <div className="custom_container">
        <UserName />
        <PagesTopTitle title="dashbaord" />
        <InfoCard />
        <div>
          <div className="row ">
            <div className="col-4 mt-3">
              <NavLink to="/hr/attendence">
                <div className="dashbaord_white_card">
                  <div className="dashbaord_white_title">
                    <p>
                      total employees: <span>20</span>
                    </p>
                  </div>
                  <ApexChart />
                </div>
              </NavLink>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
